import React from 'react'
import EachListing from "module";

function MyProperties({user}) {

    function handleSubmit(e) {
        console.log(user.listings)
    }
    return(
        <>
        <button type="button"  onClick={handleSubmit}>Click me</button>
        <div id="property-carousel" class="swiper">
          <div class="swiper-wrapper"  style={{display: 'flex', flexWrap: 'wrap', width: '100%', height: '100%', flexDirection: 'row', paddingRight: '0', justifyContent: 'center'}} >
            {user.listings.map((listing=> <EachListing key={listing} listing={listing}/>))}
          </div>
          </div>
        </>
    )
}
export default MyProperties;
